import React from 'react'

var Circle = require('rc-progress').Circle;

class Circle_c extends React.Component{
    constructor(){
        super();
        this.state = {
            color: "",
            percent: "",
        }
    }

    render(){
        var percent = this.props.vote_average*10
        if(this.props.vote_average < 3){

        }

        return(
            <div>
                <Circle percent={percent} style={{width:"50px", marginLeft:"20px"}} strokeWidth="15" strokeColor="#D3D3D3" />
            </div>
        )
    }
}

export default Circle_c
